// Dispatch SetTarget
// Once SetTarget Is Complete, 
import store from '../Store/store'

export function asyncDispatcher(payload){

  Promise.resolve(store.dispatch(targetStore(payload))).then(
    () => store.dispatch(optionsStore())
  )
}

export default asyncDispatcher;
